description:
&quot;My Wallpaper Gallery&quot; This is a very handy application to change your wallpaper on your desktop. You can easily browse throgh the categories and in one click your wallpaper is changed in what you want. You can also set your own wallpaper. goto 'file' - 'set wallpaper from file' you can browse your harddisk now for a wallpaper, select your wallpaper and click on 'open'. Your own wallpaper is now on your desktop.

Changelog:
My Wallpaper Gallery v2.0 (01-02-2014):
* Complete rewrite of the program.
* More wallpapers to choose from.
* No more gallerie downloads, just choose your wallpaper and download him.
* new website with more features and information: http://www.friendinwar.com
* reduced filesize of the complete program.
* New template in the program and installer.

